import { Component } from 'react';

class Lichess extends Component {

    constructor(props){
        super(props);

        this.state = {
            userData: null
        }
    }

    componentDidMount = () => {
        const init = {
            method: 'get',
            headers : {
                'accepts': 'application/json',
                'content-type': 'application/json',
                'Authorization': 'Bearer eOPDBXRdWyJ6TQOC',
                'Access-Control-Allow-Origin':  "https://lichess.org/api/account"
            },
            mode: 'cors'
        }

        fetch("/api/account", init)
        .then(res => res.json())
        .then(response => {
            this.setState({userData: response.data})
            console.log(response);

        })
        .catch(err => {
            this.setState({userData: err})
            console.log(err);
        })
    }

    render = () => {

        return (
            <div className="lichess">
                {this.state.userData}
            </div>
        )
    }

}

export default Lichess;
